import React from "react";
import { Route, Routes } from "react-router-dom";
import Head from "../../Helper/Head";
import { UserContext } from "../../UserContext";
import Feed from "../Feed/Feed";
import NotFound from "../NotFound";
import UserHeader from "./UserHeader";
import UserPostPhoto from "./UserPostPhoto";
import UserStats from "./UserStats";

const User = () => {
  const { data } = React.useContext(UserContext);

  return (
    <section className="container">
      <Head title="Minha conta" description={`Perfil do usuário`} />
      <UserHeader />
      <Routes>
        <Route path="/Dogs-Projeto/" element={<Feed user={data.id} />} />
        <Route path="/Dogs-Projeto/post" element={<UserPostPhoto />} />
        <Route path="/Dogs-Projeto/stats" element={<UserStats />} />
      </Routes>
    </section>
  );
};

export default User;
